resources.string:
"UniMMR=AdjustedEquity/ең төмен маржа. UniMMR – біз позицияның тәуекелін бақылау үшін пайдаланатын коэффициент.

Қалыпты: uniMMR > 2, әдеттегідей сауда;

Төмен тәуекел: 1,5 < uniMMR <= 2, әдеттегідей сауда, бірақ ликвидация ықтималдығына назар аудару қажет;

Орташа тәуекел: 1,2 < uniMMR <= 1,5, әдеттегідей сауда, бірақ ликвидацияға жол бермеу үшін қосымша қаражат қосу қажет;

Жоғары тәуекел: 1,1 < uniMMR <= 1,2, саудаға шектеу қойылған, сауда жасау, қаражат шығарып алу мүмкін емес және «reduce_only» саудасын орындауға болады;

Ликвидацияланған: 1 < uniMMR <= 1,05%, ликвидация процесі басталған.

Банкрот: uniMMR <= 1, банкрот."

"UniMMR = түзетілген капитал / техникалық қызмет көрсету маржасы.
Түзетілген меншікті капиталыңыз (АҚШ доллары) = %1$s
техникалық қызмет көрсету маржаңыз (АҚШ доллары) = %2$s

UniMMR – позиция тәуекелін бақылау үшін қолданатын коэффициентіміз.

Қалыпты: uniMMR > 2, әдеттегідей сауда;

Төмен тәуекел: 1,5 < uniMMR <= 2, әдеттегідей сауда, бірақ ликвидация ықтималдығына назар аудару қажет;

Орташа тәуекел: 1,2 < uniMMR <= 1,5, әдеттегідей сауда, бірақ ликвидацияға жол бермеу үшін қосымша қаражат қосу қажет;

Жоғары тәуекел: 1,1 < uniMMR <= 1,2, саудаға шектеу қойылған, сауда жасау, қаражат шығарып алу мүмкін емес және «reduce_only» саудасын орындауға болады;

Ликвидацияланған: 1 < uniMMR <= 1,05, ликвидация процесі басталған.

Банкрот: uniMMR <= 1, банкрот."
